import React from 'react'
import { FeatureCard } from '../lib/container'
import { FeatureImage } from '../lib/image'

export const FeatureCards = () => {
  return (
    <FeatureCard>
      <FeatureImage href='https://trusting-shannon-7747f8.netlify.com' alt='screenshot of feature project' desktopImg='images/happyfeaturedesktop.png' />
    </FeatureCard>
  )
}

export default FeatureCards
